docs/COMPONENTS.html.body:
Components
Next we will start writing out our components. This will serve as a good introduction to React.
Initialize

First we will add the needed dependencies for developing a React application:yarn add react

And the needed developer dependencies for React development (with TypeScript):yarn add -D @types/react tslint-react
The package @types/react gives us type definitions for React and tslint-react allows us to use TSLint to lint our React components.

Configuring for React
First we will configure TypeScript to work with JSX by adding the following line to our tsconfig.json:
{
    "compilerOptions": {
        "jsx": "react",
        // Rest of the compiler options
    }
    // Rest of the config file
}

As we are not using another transformation step setting jsx to the value of react will emit the actual JavaScript after compilation.

To use tslint-react we add the following lines to the file tslint.json:
{
    "extends": ["tslint-react"], // This will allow us to use tslint-react-specific rules
    "rules": {
        "jsx-no-lambda": false, // This disallows the definition of functions inside a React Component's render-function
        // The rest of the rules
        "quotemark": [true, "single", "jsx-double"] // We added "jsx-double" here to denote that in JSX one should use double quotation marks.
    }
}

Button
We will start with the simplest component that utilizes all the tools we need for most components, a Button, so go ahead and create a file Button.tsx (the extension defines the file as a TypeScript-file that has JSX in it) in the folder components:
import * as React from 'react';

interface IButtonProps {
    click(): void;
    readonly text: string;
}

const Button: React.StatelessComponent = ({ click, text }) => (
     click()} value={text} />
);

export default Button;

In the first row
import * as React from 'react';

we import all the functionalities provided by React under the name React (* as React), including the ability to write JSX (those things that look like HTML).

On the third to sixth rows
interface IButtonProps {
    click(): void;
    readonly text: string;
}

we define an interface to denote the properties (or props for short) our component accepts (and in this case needs). click() defines a function, which will be known as click inside our Button and as we have only defined that it takes no arguments, we also tell the compiler that we don't care if it returns anything, just that it can be called, using the return type of void. readonly text: string on the other hand defines a readonly (an immutable property) called text inside our Button, that is of the type string.

Interfaces are shapes we define, meaning that we do not care what the actual implementation is, just that it has those types of values with those names. They cannot be instantiated as such and thus cannot contain default values like classes.


On the eighth to tenth rows
const Button: React.StatelessComponent = ({ click, text }) => (
     click()} value={text} />
);

we define a constant (an immutable variable) called Button which is of the type React.StatelessComponent, meaning it is a React component, which does not have an internal state, but only props of type IButtonProps. Stateless components in React only need to define their render-method and using an ES6 arrow function and a destructuring assignment we can return JSX with our props already defined as simple variables (in this case "click" and "text"). The actual return here is a simple HTML input element with a class of btn (in React you define classes with the property "className"), a type of submit, an onClick-handler that will simply call the click-property and a value of text (in submit buttons the value is the text in the button).

You need to surround JSX with parentheses.


And finally on the twelfth row
export default Button;

we export our Button as the default export of the module.
TodoComponent
Next we will define a component to visualize our Todo-class from the previous section, creating a file called TodoComponent.tsx in the components-folder:
import * as React from 'react';
import Todo from '../common/Todo';

export interface ITodoComponent {
    readonly todo: Todo;
    setDone(i: number): void;
}

const TodoComponent: React.StatelessComponent = ({ todo, setDone }) => (

         !todo.done && setDone(todo.id)}
        />
        {todo.id}:
        {todo.title}

);

export default TodoComponent;

which is mostly very similar to our Button. The biggest differences here are the second import
import Todo from '../common/Todo';

which imports our Todo-class using a relative path (the TypeScript compiler will look for the file relative to the current file) and the second property in our interface
    setDone(i: number): void;

which defines a function called setDone that takes one argument, which is a number.
Loader
Next we implement our third and simplest component, called a Loader, in a file called Loader.tsx in the components-directory
import * as React from 'react';

const Loader: React.StatelessComponent = () => (



);

export default Loader;

which uses all previously introduced tools, except this time we have defined the props it receives as undefined, meaning that it does not take any props at all.
PageNotFound
Lastly we create a page to be shown whenever user enters a URL that is not found (a 404), called PageNotFound in the components-directory
import * as React from 'react';

const PageNotFound: React.StatelessComponent = () => (

        404 - page not found

);

export default PageNotFound;

which is again a very simple component, very similar to Loader.
Alternatives
Below you can find alternatives to React, although I would suggest React unless you have specific needs, which other frameworks solve better, as it also allows for mobile development with React Native.

AngularJS, possibly the most popular framework after React
elm, a functional alternative
Cycle.js, a functional reactive alternative

docs/REDUX.html.body:
Redux
Next we will setup redux to handle the state for our application (redux allows us to keep our components pure, helping testing and predictability).

You can think of redux as an implementation of the Flux pattern, where the main point is that data flows into a single direction.

Initialize

This time we will only need to add the necessary dependencies to allow development with redux:yarn add redux redux-observable rxjs react-router-redux@next history

Add the necessary type definitions (redux, redux-observable and rxjs contain type definitions):yarn add -D @types/react-router-redux @types/history

Redux-observable is our choice for allowing side effects, such as AJAX-calls in redux. RxJS is a peer dependency for redux-observable. If you want something else you can check the alternatives. React-router-redux is used to tie navigation events and browser history into redux when using React Router (which well setup later), and history is needed to use react-router-redux.



Creating utilities
We will begin by creating a file called utils.js inside the folder redux in src. This file will contain helpers for our redux functionalities and will serve as good introduction into one of its most basic building blocks. The file will initially look like this:
export type DefaultAction = { type: '' };
export const DefaultAction: DefaultAction = { type: '' };

Actions are the only way to send new content to the redux-state, and are usually in the form of an object with the properties type (a unique string) and an optional payload (something to pass to the reducer). Here we have defined a DefaultAction which will allow our reducers to pass unnecessary actions forward without losing type-safety. The empty string as a type ensures that it doesn't intersect with any of our own actions.
Reducer
Now we will define our root-reducer in a file called reducer.ts inside the folder redux:
import { combineReducers } from 'redux';
import { combineEpics } from 'redux-observable';
import { routerReducer, RouterState, RouterAction, LocationChangeAction } from 'react-router-redux';
import { DefaultAction } from './utils';

const reducer = combineReducers({
    router: routerReducer,
});

export class State {
    readonly router: RouterState = null;
}

export const epics = combineEpics(
);

export type Actions = DefaultAction | LocationChangeAction | RouterAction;

export default reducer;

This file will allow us to export all of the following:

Our root reducer (all specific reducers will be combined into this one, as according to redux documentation, allowing our reducers to only handle a slice of the entire state) made with combineReducers
The class of our entire state (defined as a class to allow initialization in for example tests)
Our combined epics (more about epics later) made with combineEpics
The type of all of our actions
We add the types of react-router-redux as well so type-checking knows to look for them if we need them (this is only necessary if you use them somewhere)



Store
Now we will define our store creator. Having it as a separate function helps us in doing server-side rendering but if you don't want to do it you can define this function later. The store creator goes in a file called store.ts inside the redux-folder:
import { createStore, applyMiddleware } from 'redux';
import { createEpicMiddleware } from 'redux-observable';
import { History } from 'history';
import { routerMiddleware } from 'react-router-redux';
import reducer, { epics, State } from './reducer';

const epicMiddleware = createEpicMiddleware(epics);

const configureStore = (history: History) => createStore(
    reducer,
    applyMiddleware(routerMiddleware(history), epicMiddleware),
);

export default configureStore;


On the fifth line we create a middleware for our store to handle our epics, using createEpicMiddleware (and here you see why we combined all our epics into one):
import { createEpicMiddleware } from 'redux-observable';
import { epics } from './reducer';
const epicMiddleware = createEpicMiddleware(epics);


And then on the seventh line we define our store creator method (which is exported on the 14th line):
import { createStore, applyMiddleware, Store } from 'redux';
import { History } from 'history';
import { routerMiddleware } from 'react-router-redux';
import reducer, { State } from './reducer';
const configureStore = (history: History) => createStore(
    reducer,
    applyMiddleware(routerMiddleware(history), epicMiddleware),
);
export default configureStore;

createStore is the function that creates a Store for redux and as it's first argument it takes the root-reducer and as the second one all the applicable middleware (combined with applyMiddleware), in this case our epicMiddleware and routerMiddleware. The function configureStore takes a History as an argument, to allow us to call it with different types of histories.

Now we have everything set up to start doing the beef of the application, a.k.a. the views!
Alternatives
If redux doesn't float your boat, you can always try MobX, but redux is maybe the more used one at this point.
For redux-observable you have multiple alternatives, namely:

redux-loop, which is inspired by elm's effect system
redux-thunk
redux-saga

docs/VIEWS.html.body:
Views
Now we are ready to start working towards the beef of the application: different pages (or views).
IndexView
We will begin by creating a file called IndexView.tsx (remember that 'x' in the end of the file type means that it contains jsx) inside a folder called index inside the components-folder:

All of our pages will be inside folders named after the page, in this case Index and the view will be named [Pagename]View.tsx

import * as React from 'react';
import Todo from '../../common/Todo';
import TodoComponent from '../../components/TodoComponent';
import Button from '../../components/Button';
import Loader from '../../components/Loader';

interface IIndexState {
    title: string;
    todos: Todo[];
    loading: boolean;
}

interface IIndexDispatch {
    setTitle(n: string): void;
    saveTodo(): void;
    setDone(i: number): void;
}

type IIndexProps = IIndexState & IIndexDispatch;

const IndexView: React.StatelessComponent = ({ title, todos, loading, setTitle, saveTodo, setDone }) => (

        {loading && }
        Todo app
         e.preventDefault()}>
            Add a new todo:
             setTitle(e.target.value)}
            />




            {todos.map(t => )}


);

export default IndexView;


The first interface we declare, called IIndexState
import Todo from '../../common/Todo';
interface IIndexState {
    title: string;
    todos: Todo[];
    loading: boolean;
}

is an interface that holds the "state"-values for our View, i.e. the stuff that defines what is shown to the user, in this case a title (the title of the current Todo being created), a list of Todos (the current Todos) and a boolean that indicates whether or not some kind of long-taking call is currently running.

The second interface we declare, called IIndexDispatch
interface IIndexDispatch {
    setTitle(n: string): void;
    saveTodo(): void;
    setDone(i: number): void;
}

is an interface that holds all the "dispatch"-functions for our View, i.e. all the functionality that our users can trigger, in this case a function (setTitle(n: string)) to change the current title (that takes a string as an argument), a function (saveTodo()) to save the new Todo and a function (setDone(i: number)) to set an existing Todo as done (that takes the number of the Todo as argument).

Having void as a return type allows us to not care about the return type (which we don't need here) without having an implicit any


Together IIndexState and IIndexDispatch form the type IIndexProps
type IIndexProps = IIndexState & IIndexDispatch;

which is the definition of all the props our IndexView will need to function.

The IIndexState & IIndexDispatch part defines that the type called IIndexProps is an intersection of those two interfaces, meaning that to fulfill the type, the object needs to have all values present in both of the aforementioned interfaces.


And now we get to the beef of it all, starting with declaring the actual IndexView
import * as React from 'react';
const IndexView: React.StatelessComponent = ({ title, todos, loading, setTitle, saveTodo, setDone }) => (
);

in which we declare a constant called IndexView which is of the type React.StatelessComponent. React.StatelessComponent is a type of React Component that does not have an internal state, only props and can be declared as a function that returns jsx, where the type of props received is put inside the angle brackets (where T is now).

These kinds of declarations are called type arguments or generics, which allow you to define a function without knowing beforehand what the type of the argument or return value is.

After declaring the const we define IndexView to be a function, that fulfills the render function, i.e. takes in an object containing the declared properties (using object destructuring so we don't have to write something.title, instead of title) and returns jsx encapsulated in the brackets.

For the actual content inside the brackets you can think of it as "HTML on steroids", beginning, as is semantically correct with a main tag



which will hold all the content of our IndexView (and here we begin the introduction of BEM-naming).

Next is our first tag that is different with different props
import Loader from '../../components/Loader';
// ...

        {loading && }


which means, that depending if the prop loading is true (using logical operator-shorthand that returns the right hand-side if the both sides evaluate as true), we want to render the Loader-component we defined earlier in the Components section.

Next up we define the title and a form to add a new Todo

    // ...

        Todo app
         e.preventDefault()}>
            Add a new todo:
             setTitle(e.target.value)}
            />




where we first define the title (in this case a static string Todo app). Next we define a form to create new Todos which introduces us to a lot of nice features of React, but first we do a little "hack" as we want to enable the user to press the enter-key when submitting a new Todo but we don't want to send the form to a new page, we set the value of onSubmit (the handler for a form's submit method in React) as e => e.preventDefault() where e is the event received and it's function .preventDefault() will (as its name implies) prevent the default functionality (in this case send the form data to the current url, causing a reload).
Next we define a label for the input-field utilizing React's htmlFor-value which is an alias for the for-attribute, except it uses the name-field instead of id for matching. Then we define the actual input-field for inputting a Todo, which is a simple text input, but we also make it autofocus (if you open the page, you can start typing into it directly) and make it a controlled component, meaning that whenever the value of title changes, the input will also update. We also add the onChange-listener to actually set the new title the user has typed in. Finally we create a simple Button (we defined earlier in components) to submit the form.

Finally we want to of course show all the Todos created

        // ...

            {todos.map(t => )}



where we first encapsulate it into a semantic tag called section. Then we want to create a new TodoComponent (as we defined in components) for every Todo in our current state, which can be achieved by a simple map (I highly recommend getting to know all the major Array-functions). Here you want to also remember to add a property for our TodoComponent it isn't expecting to receive: key which React uses to distinguish between tags in a list (it has to be unique inside the list).
Alternatives

If you want something a bit simpler you can try Vue.js
Or the classic jQuery

docs/REDUCERS.html.body:
Reducers
Now we build our business logic, also known as reducers. Stay calm, this will be a bit more complicated than anything before.
IndexReducer
We begin by creating a file called IndexReducer.ts in the src/modules/index-folder

Our reducers follow the naming pattern of [Foldername]Reducer

import { MiddlewareAPI } from 'redux';
import { Observable } from 'rxjs/Observable';
import { ajax } from 'rxjs/observable/dom/ajax';
import 'rxjs/add/operator/delay';
import 'rxjs/add/operator/map';
import 'rxjs/add/operator/mapTo';
import { Epic, combineEpics, ActionsObservable } from 'redux-observable';
import { DefaultAction } from '../../redux/utils';
import Todo from '../../common/Todo';

export class IndexState {
    readonly title: string = '';
    readonly todos: Todo[] = [];
    readonly loading: boolean = false;
}

type SET_TITLE = 'boilerplate/Index/SET_TITLE';
const SET_TITLE: SET_TITLE = 'boilerplate/Index/SET_TITLE';
type SAVE_TODO = 'boilerplate/Index/SAVE_TODO';
const SAVE_TODO: SAVE_TODO = 'boilerplate/Index/SAVE_TODO';
type SAVE_TODO_SUCCESS = 'boilerplate/Index/SAVE_TODO_SUCCESS';
const SAVE_TODO_SUCCESS: SAVE_TODO_SUCCESS = 'boilerplate/Index/SAVE_TODO_SUCCESS';
type SET_DONE = 'boilerplate/Index/SET_DONE';
const SET_DONE: SET_DONE = 'boilerplate/Index/SET_DONE';
type SET_DONE_SUCCESS = 'boilerplate/Index/SET_DONE_SUCCESS';
const SET_DONE_SUCCESS: SET_DONE_SUCCESS = 'boilerplate/Index/SET_DONE_SUCCESS';

type SetTitleAction = { type: SET_TITLE, payload: string };
export const setTitle = (title: string): SetTitleAction => ({ type: SET_TITLE, payload: title });
type SaveTodoAction = { type: SAVE_TODO };
export const saveTodo = (): SaveTodoAction => ({ type: SAVE_TODO });
type SaveTodoSuccessAction = { type: SAVE_TODO_SUCCESS };
const saveTodoSuccess = (): SaveTodoSuccessAction => ({ type: SAVE_TODO_SUCCESS });
type SetDoneAction = { type: SET_DONE, payload: number };
export const setDone = (i: number) => ({ type: SET_DONE, payload: i });
type SetDoneSuccessAction = { type: SET_DONE_SUCCESS, payload: number };
const setDoneSuccess = (i: number): SetDoneSuccessAction => ({ type: SET_DONE_SUCCESS, payload: i });

export type IndexActions = SetTitleAction | SaveTodoAction | SaveTodoSuccessAction | SetDoneAction | SetDoneSuccessAction | DefaultAction;

const saveTodoEpic: Epic = (action$: ActionsObservable): Observable =>
    action$.ofType(SAVE_TODO)
        .delay(1000)
        .mapTo(saveTodoSuccess());

const setDoneEpic: Epic = (action$: ActionsObservable): Observable =>
    action$.ofType(SET_DONE)
        .delay(1000)
        .map((action: SetDoneAction) => setDoneSuccess(action.payload));

export const IndexEpics = combineEpics(saveTodoEpic, setDoneEpic);

const IndexReducer = (state: IndexState = new IndexState(), action: IndexActions = DefaultAction): IndexState => {
    switch (action.type) {
        case SET_TITLE:
            return { ...state, title: action.payload };
        case SAVE_TODO:
            return { ...state, loading: true };
        case SAVE_TODO_SUCCESS:
            return {
                ...state,
                title: '',
                todos: state.todos.concat(new Todo(state.todos.length + 1, state.title)),
                loading: false,
            };
        case SET_DONE:
            return { ...state, loading: true };
        case SET_DONE_SUCCESS:
            return {
                ...state,
                todos: state.todos.map(t => t.id === action.payload ? t.setDone() : t),
                loading: false,
            };
        default:
            return state;
    }
};

export default IndexReducer;


First we define the state for our IndexReducer

Reducers usually define their own state and we'll show you later how to connect it to the main reducer and state

import Todo from '../../common/Todo';

export class IndexState {
    readonly title: string = '';
    readonly todos: Todo[] = [];
    readonly loading: boolean = false;
}

which is fairly simple. Here we define the IndexState as a class, with the given properties (make sure you add default values for required properties so you can instantiate it!), with the title for the current Todo the user is creating, todos for the list of current Todos and loading to show the user whether the application is performing an async call or not.

Next up we define our action types
type SET_TITLE = 'boilerplate/Index/SET_TITLE';
const SET_TITLE: SET_TITLE = 'boilerplate/Index/SET_TITLE';
type SAVE_TODO = 'boilerplate/Index/SAVE_TODO';
const SAVE_TODO: SAVE_TODO = 'boilerplate/Index/SAVE_TODO';
type SAVE_TODO_SUCCESS = 'boilerplate/Index/SAVE_TODO_SUCCESS';
const SAVE_TODO_SUCCESS: SAVE_TODO_SUCCESS = 'boilerplate/Index/SAVE_TODO_SUCCESS';
type SET_DONE = 'boilerplate/Index/SET_DONE';
const SET_DONE: SET_DONE = 'boilerplate/Index/SET_DONE';
type SET_DONE_SUCCESS = 'boilerplate/Index/SET_DONE_SUCCESS';
const SET_DONE_SUCCESS: SET_DONE_SUCCESS = 'boilerplate/Index/SET_DONE_SUCCESS';

which redux recommends to be constant strings. The reason we first define a type for the action type is to get TypeScript to do some of the work for us, by ensuring that each instance of the action type has the same value, so for example a constant of SET_TITLE: SET_TITLE = 'notcorrect' would raise a compiler error from TypeScript as it is not equal to boilerplate/Index/SET_TITLE.

Here we follow the redux-ducks naming pattern of the format applicationName/ViewName/ACTION_TYPE


Next we define our action creators which are functions that return an action
type SetTitleAction = { type: SET_TITLE, payload: string };
export const setTitle = (title: string): SetTitleAction => ({ type: SET_TITLE, payload: title });
type SaveTodoAction = { type: SAVE_TODO };
export const saveTodo = (): SaveTodoAction => ({ type: SAVE_TODO });
type SaveTodoSuccessAction = { type: SAVE_TODO_SUCCESS };
const saveTodoSuccess = (): SaveTodoSuccessAction => ({ type: SAVE_TODO_SUCCESS });
type SetDoneAction = { type: SET_DONE, payload: number };
export const setDone = (i: number) => ({ type: SET_DONE, payload: i });
type SetDoneSuccessAction = { type: SET_DONE_SUCCESS, payload: number };
const setDoneSuccess = (i: number): SetDoneSuccessAction => ({ type: SET_DONE_SUCCESS, payload: i });

of a specific type with a specific payload (which is the way to pass new information to the reducer). In this case we also first define the type for each of the possible actions at the same time as the action creator.

After defining our actions and action creators we also create a combined type of all of them
import { DefaultAction } from '../../redux/utils';

export type IndexActions = SetTitleAction | SaveTodoAction | SaveTodoSuccessAction | SetDoneAction | SetDoneSuccessAction | DefaultAction;

to allow us to later define when we want to receive an action for our Index-page and later combine them to create a shared type for all the actions in our application.

Next we define our Epics
import { Observable } from 'rxjs/Observable';
import 'rxjs/add/operator/delay';
import 'rxjs/add/operator/map';
import 'rxjs/add/operator/mapTo';
import { Epic, combineEpics, ActionsObservable } from 'redux-observable';

const saveTodoEpic: Epic = (action$: ActionsObservable): Observable =>
    action$.ofType(SAVE_TODO)
        .delay(1000)
        .mapTo(saveTodoSuccess());

const setDoneEpic: Epic = (action$: ActionsObservable): Observable =>
    action$.ofType(SET_DONE)
        .delay(1000)
        .map((action: SetDoneAction) => setDoneSuccess(action.payload));

export const IndexEpics = combineEpics(saveTodoEpic, setDoneEpic);

which are redux-observable's way of handling side-effects in Redux (like AJAX calls etc.). At the end we combine all our Epics in this file to a single exportable Epic called IndexEpics (so we only need to import one variable when we want access to these later).

The importing part may look a little weird, but it's because RxJS is a rather large library, we can either import everything using import * as RxJS from 'rxjs' or import only the parts we need as shown above, which will allow any proper minifier like UglifyJS to include only the needed parts from RxJS

The first line
const saveTodoEpic: Epic = (action$: ActionsObservable): Observable =>

defines an Epic which takes in as the first type argument the type for the Actions the epic takes in (and returns), in this case IndexActions which we defined earlier, and as the second argument the type of the State it takes in (which isn't needed this time, so undefined will do). An Epic is a function that takes in a stream) (in this case of the type ActionsObservable) which includes items of the type given as the first type argument and returns another stream (in this case an Observable, which ActionsObservable is based on) which includes items of the same type as the input stream.

In JavaScript the convention is to append a $ to all variables names that are streams, to let the developer know that they are dealing with one

The second line
    action$.ofType(SET_DONE)

utilizes the inbuilt function ofType(key: string) of ActionsObservable, which basically filters out all actions that do not have the type-property of the given argument.

A more verbose, but maybe a simpler to understand version would be to write
action$.filter(action => action.type === SET_DONE)

If you find yourself needing to understand the types of the components provided by redux-observable I suggest reading this

The third and fourth line
        .delay(1000)
        .mapTo(saveTodoSuccess());

include the actual functionality of our Epic. In this case after we receive an action of the type SET_DONE we wait for 1 second (delaytakes milliseconds as argument) and then we return an action of the type SAVE_TODO_SUCCESS (in this case using mapTo as we just want to return a new Action).

If you wanted to return multiple actions, say SET_DONE_SUCCESS and an imaginary SEND_PUSH_NOTIFICATION you could do it using mergeMap, which is kind of like flatMap, like so:
import { Observable } from 'rxjs/Observable';
import 'rxjs/add/observable/from';
import 'rxjs/add/operator/mergeMap';
...
    action$.ofType(SET_DONE)
        .mergeMap((action: SetDoneAction) => Observable.from([
            setDoneSuccess(action.payload),
            // SEND_PUSH_NOTIFICATION,
            // OTHER ACTIONS,
        ]));


The other Epic is otherwirse similar, but it uses map
        .delay(1000)
        .map((action: SetDoneAction) => setDoneSuccess(action.payload));

to return an action of the type SET_DONE_SUCCESS, using the payload of the incoming action.

If you wanted to do an AJAX call, you would go about it like this:
import { ajax } from 'rxjs/observable/dom/ajax';
...
    action$.ofType(AJAX_CALL).mergeMap((action: AjaxCallAction) => {
        // For a get JSON call
        ajax.getJSON('url', { headers: 'go here' })
            .map(response => someAction(response))
            .catch(err => errorAction(err));
        // For all other calls, just select the correct verb
        ajax.post('url', payload, { headers: 'go here' })
            .map(response => someAction(response))
            .catch(err => errorAction(err));
    });

Redux-observable is built upon RxJS, the JavaScript implemention of ReactiveX and most issues you will run into will be RxJS issues


Finally we define the rest of our business logic, a.k.a. the reducer itself
const IndexReducer = (state: IndexState = new IndexState(), action: IndexActions = DefaultAction): IndexState => {
    switch (action.type) {
        case SET_TITLE:
            return { ...state, title: action.payload };
        case SAVE_TODO:
            return { ...state, loading: true };
        case SAVE_TODO_SUCCESS:
            return {
                ...state,
                title: '',
                todos: state.todos.concat(new Todo(state.todos.length + 1, state.title)),
                loading: false,
            };
        case SET_DONE:
            return { ...state, loading: true };
        case SET_DONE_SUCCESS:
            return {
                ...state,
                todos: state.todos.map(t => t.id === action.payload ? t.setDone() : t),
                loading: false,
            };
        default:
            return state;
    }
};

for which I suggest to break from the redux-ducks pattern by using the naming convention of [Pagename]Reducer. The important thing to remember with reducers is that they have to be functional, a.k.a. they are not allowed to mutate the incoming information or have side-effects.
On the first line we define the signature of our IndexReducer
const IndexReducer = (state: IndexState = new IndexState(), action: IndexActions = DefaultAction): IndexState =>

where we define it to take to parameters (as all reducers), our IndexState (with a default for the empty state) and an action. IndexReducer will also return an IndexState (as all reducers).
Next we do the actual logic which all reducers are built upon
    switch (action.type) {
        case SET_TITLE:
            return { ...state, title: action.payload };
        case SAVE_TODO:
            return { ...state, loading: true };
        case SAVE_TODO_SUCCESS:
            return {
                ...state,
                title: '',
                todos: state.todos.concat(new Todo(state.todos.length + 1, state.title)),
                loading: false,
            };
        case SET_DONE:
            return { ...state, loading: true };
        case SET_DONE_SUCCESS:
            return {
                ...state,
                todos: state.todos.map(t => t.id === action.payload ? t.setDone() : t),
                loading: false,
            };
        default:
            return state;
    }

which is a switch-statement over the type-property of the incoming action. In each case we do something (except the default-one, where you traditionally just return the incoming state) to add value to that action, such as setting the title to the payload in the action in case the action is a SET_TITLE-action. Notice how we are using the spread syntax to immutably create a new version of the state, thus holding true to the immutability of reducers.

Other options are to use Object.assign({}, ...) or Immutable

Connecting the reducer
Remember our root-reducer? Now we connect our IndexReducer to it.
First the reducer itself
import { combineReducers } from 'redux';
import IndexReducer from '../modulex/index/IndexReducer';

const reducer = combineReducers({
    index: IndexReducer,
});

where we add the IndexReducer under the key index, which is very important, as when combineReducers combines included reducers it will put their specific state under the key given, in the global state-object.
Next we add the IndexState to our global State-class (this is just to allow us to define the type and initialize it for tests later on)
import { IndexState } from '../modules/index/IndexReducer';

export class State {
    readonly index: IndexState = new IndexState();
}

where we define that the global State-object has a property index of the type IndexState (as our combineReducer already says, but we want to be explicit here).
Then we want to add our Epics into the global epics constant
import { combineEpics } from 'redux-observable';
import { IndexEpics } from '../modules/index/IndexReducer';

export const epics = combineEpics(IndexEpics);

by including it as a parameter to combineEpics.
Finally we add our IndexActions to the global Actions-type
import { DefaultAction } from './utils';
import { IndexActions } from '../modules/index/IndexReducer';

export type Actions = DefaultAction | IndexActions;

where we say that Actions is a type where the value is either of a type of DefaultAction or one of the IndexActions.

docs/CONTAINERS.html.body:
Containers
Next up we want to bind our Views to our Reducers, a.k.a. define how we get the props from our state.
Initialize
First up we need to add a new dependency, react-redux to connect our React views to our state
yarn add react-redux
and the type definitions for it
yarn add -D @types/react-redux
IndexContainer
We begin by creating a file called IndexContainer.ts inside our index-folder inside src/modules

All containers will have the same "prefix" as their accompanied views, a.k.a. [Pagename]Container.ts

import { connect } from 'react-redux';
import { State } from '../../redux/reducer';
import { setTitle, saveTodo, setDone } from './IndexReducer';
import IndexView, { IIndexState, IIndexDispatch, IIndexProps } from './IndexView';

const stateToProps = (state: State): IIndexState => ({
    title: state.index.title,
    todos: state.index.todos,
    loading: state.index.loading,
});

export default connect(stateToProps, {
    setTitle,
    saveTodo,
    setDone,
})(IndexView);


First we define a function to transform our State into the IIndexState required by our IndexView
import { State } from '../../redux/reducer';
import { IIndexState } from './IndexView';

const stateToProps = (state: State): IIndexState => ({
    title: state.index.title,
    todos: state.index.todos,
    loading: state.index.loading,
});

where we get the required information from the State and return it with the correct key.

Thanks to a shorthand in react-redux we can just define the actions we need in the component by putting them in an object as the second argument for connect
import { connect } from 'react-redux';
import { setTitle, saveTodo, setDone } from './IndexReducer';
import { IIndexState, IIndexDispatch, IIndexProps } from './IndexView';

export default connect(stateToProps, {
    setTitle,
    saveTodo,
    setDone,
})

where connect uses internally the function bindActionCreators for each action in the object and passes them on as functions that dispatch automatically. They will be named the same as they are in the object, so for example setTitle will be accessible as this.props.setTitle in the component.

Finally we bind it all using react-redux's connect
import { connect } from 'react-redux';
import { setTitle, saveTodo, setDone } from './IndexReducer';
import IndexView, { IIndexState, IIndexDispatch, IIndexProps } from './IndexView';

const stateToProps = ...

export default connect(stateToProps, {
    setTitle,
    saveTodo,
    setDone,
})(IndexView);

where the first type argument is the type for the format we want to transform our state to (in this case our IIndexState), the second type argument is the format we want to transform the dispatch-function to (in this case our IIndexDispatch) and the last type argument is the type for the props our view expects. The first argument connect takes is a function to transform our state into the type of the first type argument and the second argument is a function to transform the dispatch-function into the second type argument (here we also see for the first time a curried function). The last argument is our view itself, which should be expecting props of the type of the third type argument.

docs/COMPLETING.html.body:
Completing React
Now we finally get to build our React-application into something that can be run and will actually do something! Here we make the assumption that you are going to build a medium- to large-sized application and show how to do these things in a more modular way, but for smaller applications some of these parts can be merged with the IndexView and some can be left out completely.
Initialize
We begin by installing new dependencies called React Router and ReactDOM
yarn add react-router-dom react-dom
which adds the capability to define which URL equals which view and to render our React application to the DOM, respectively.
And of course the types for them
yarn add -D @types/react-router-dom @types/react-dom
AppView
We begin by writing an AppView.ts file into the src/modules-folder
import * as React from 'react';
import { Route, Switch, RouteComponentProps } from 'react-router-dom';
import IndexContainer from './index/IndexContainer';
import PageNotFound from '../components/PageNotFound';

export type IAppViewProps = RouteComponentProps;

const AppView: React.StatelessComponent = () => (






);

export default AppView;

which is a fairly simple view, except for the -clause and RouteComponentProps.

All views that go through React Router get some extra properties, which are included in RouteComponentProps, where Params can be used to define possible parameters for the URL.

The  element is used to render a single view out of all Routes inside the . Routes have three main properties you should remember:

path which indicates what URL the view matches to (it can be used to define parameters as well)
exact which indicates that the view should only match if the URL matches path exactly
component which defines the actual view to render

AppContainer
Next we create a very simple container for AppView called AppContainer, which is situated in the same src/modules-folder
import { connect } from 'react-redux';
import AppView, { IAppViewProps } from './AppView'; //tslint:disable-line:no-unused-variable

export default connect(() => ({}))(AppView);

which we use just to wrap AppView so that it can be used in routes.
IndexView
For IndexView we also need to add RouteComponentProps, so just add the following
import { RouteComponentProps } from 'react-router-dom';
// ...
export type IIndexProps = IIndexState & IIndexDispatch & RouteComponentProps;

index
Finally we create a file index.ts inside src
import * as React from 'react';
import * as ReactDOM from 'react-dom';
import { Provider } from 'react-redux';
import { Route } from 'react-router-dom';
import { ConnectedRouter } from 'react-router-redux';
import { AppContainer as HotContainer } from 'react-hot-loader';
import createHistory from 'history/createBrowserHistory';
import configureStore from './redux/store';
import AppContainer from './modules/AppContainer';

const history = createHistory();

const render = (container: React.ComponentClass) => ReactDOM.render(






    ,
    document.getElementById('app'),
);

render(AppContainer);

if ((module as any).hot) {
    (module as any).hot.accept('./modules/AppContainer', () => render(AppContainer));
}

which is the entry file to our application that ties everything together.

On the 14. line
import * as ReactDOM from 'react-dom';

const render = (container: React.ComponentClass) => ReactDOM.render(
    // ...,
    document.getElementById('app'),
))

we render our React-application to the DOM inside a div with the id app (we'll come back to this).

On the 15. line
import { AppContainer as HotContainer } from 'react-hot-loader';
// ...

        // ...
    ,

we wrap our application into a container to enable Hot Module Replacement (more about it later in this section).

On the 16. line
import * as React from 'react';
import { Provider } from 'react-redux';
import createHistory from 'history/createBrowserHistory';
import configureStore from './redux/store';
const history = createHistory();
// ...

            // ...


which wraps our React application with Redux using Provider from react-redux, which takes a single parameter store, for which we provide our store as we defined it in Redux. history/createBrowserHistory is used to create a wrapper around the browser history we can use.

On the 17. line
import * as React from 'react';
import { Route } from 'react-router-dom';
import { ConnectedRouter } from 'react-router-redux';
import AppContainer from './modules/AppContainer';
// ...



// ...

we keep the UI in sync with the URL using a ConnectedRouter from react-router-redux, which takes as argument a history, where we give history we created previously. Here we define a single Route which renders AppContainer for all URL routes.

Finally at the end
if ((module as any).hot) {
    (module as any).hot.accept('./modules/AppContainer', () => render(AppContainer));
}

we do a little configuration to allow our container to be loaded by the Hot Module Replacement-system.
Index.html
Finally we write an index.html in our root-folder




        TS-React boilerplate







which is just a very simple HTML-file, which imports our (soon-to-be-bundled) JavaScript from the current folder /bundle.js and contains a div with the id app so our index.ts works.

docs/WEBPACK.html.body:
webpack
Now as we have everything necessary for our application, it's time to get it working!
Initialize
We'll begin by installing a "couple" of new dependencies
yarn add -D webpack webpack-dev-server source-map-loader react-hot-loader copy-webpack-plugin babel babel-cli babel-core babel-loader babel-preset-env awesome-typescript-loader html-webpack-plugin
from which webpack is a very powerful tool for bundling and configuration, webpack-dev-server is a lightweight server to host client code, source-map-loader to allow errors and other messages to be pointed to the right source code lines while developing, react-hot-loader to allow for Hot Module Replcement (HMR), copy-webpack-plugin to copy our index.html over to webpack's process, babel and it's plugins to speed up our process and awesome-typescript-loader to use webpack with TypeScript. Finally we also add html-webpack-plugin to generate an index.html for us in the build phase.

First we need a couple of configuration files for webpack to get started. (There are a few ways to have multiple different configurations for webpack simultaneously and the way I do it here is just one of them.) Begin by creating a file in your root folder called webpack.config.js, which will look like this:
module.exports = function(env) {
    return require('./webpack.' + env + '.js');
}

This file is simply a way to call one configuration file from our script and provide it with an environment variable that will call the corresponding configuration.

To actually use Babel we need to give it a simple configuration inside our root folder within a file called .babelrc:
{
  "presets": ["babel-preset-env"],
  "plugins": ["react-hot-loader/babel"]
}

where the presets gives us automatic compilation down to ES5 via babel-preset-env and the plugins allows Babel to work together with our Hot Module Replacement.
Development
For our development configuration we will need another file in our root folder, called webpack.dev.js so create the file and type in the following:
var path = require('path');
var webpack = require('webpack');
var CopyWebpackPlugin = require('copy-webpack-plugin');

module.exports = {
    context: __dirname,
    entry: [
        'react-hot-loader/patch',
        'webpack-dev-server/client?http://localhost:9966',
        'webpack/hot/only-dev-server',
        path.resolve(__dirname, 'src', 'index.tsx')
    ],
    output: {
        filename: 'bundle.js',
        path: path.resolve(__dirname, 'dist', 'js'),
        publicPath: '/'
    },
    devtool: 'source-map',
    devServer: {
        hot: true,
        contentBase: path.resolve(__dirname, 'dist'),
        publicPath: '/',
        historyApiFallback: true
    },
    module: {
        rules: [
            {
                enforce: 'pre',
                test: /\.js$/,
                loader: 'source-map-loader'
            },
            {
                test: /\.tsx?$/,
                use: ['react-hot-loader/webpack', 'awesome-typescript-loader'],
                exclude: /node_modules/
            }
        ]
    },
    resolve: {
        extensions: ['.tsx', '.ts', '.js']
    },
    plugins: [
        new CopyWebpackPlugin([{ from: path.resolve(__dirname, 'index.html') }]),
        new webpack.EnvironmentPlugin({ 'NODE_ENV': 'development' }),
        new webpack.HotModuleReplacementPlugin(),
        new webpack.NamedModulesPlugin(),
        new webpack.NoEmitOnErrorsPlugin()
    ]
};

Now there is a lot to digest, but we'll go through the sections one by one.
The first section after module.exports (which just tells JavaScript that when this file is called, we want the following lines to be called), context, simply gives our configuration a location context to work in, in this case __dirname, which is a variable Node.JS gives us to point to our current location.
The second section gets a little more interesting, entry, which contains a few lines of strings. The first tells webpack to use the patch-mode from react-hot-loader, meaning that we do not have to refresh the whole page when something changes in our code, only the affected parts will be updated. The second line webpack-dev-server/client?http://localhost:9966 tells webpack where we want our webpack-dev-server to run (in this case inside port 9966). The third line webpack/hot/only-dev-server tells webpack-dev-server that we want to do HMR. Finally the fourth line path.resolve(__dirname, 'src', 'index.tsx') is the most important one, as it tells webpack where our application actually starts from, a.k.a. the entry file.
The third section, output tells webpack where we want our compiled and bundled code to come out to. The first line filename tells webpack to store our bundled file as bundle.js. The second line configures the location for our bundle.js under path, in this case a folder js inside dist. Finally the publicPath variable sets the base path for all assets (such as images and stylesheets) for your application, in this case the same as the context folder.
The fourth section devtool is a simple section, which sets if and how source maps are generated, in our case, using source-map-loader.
The fifth section devServer allows configuration for the development server. hot defines whether we want HMR or not (in our case yes), contentBase tells the server where to serve content from, in this case the dist-folder. publicPath defines where our files are accessible from the browser, in this case from the root. historyApiFallback will allow the server to serve index.html even if any other path is requested, as is the case when using react-router.
The sixth section module defines how different types of files are processed. In our case we have two different rules, one for JavaScript files and one for TypeScript files. The one for TypeScript files consists of a test, to see whether we want to use this rule or not, a use, meaning which loaders to use and an exclude, to determine excluded files. The JavaScript rule is enforced as  pre, meaning it'll come into affect for files coming out of other rules (a.k.a. our compiled TypeScript files) and will be passed through to source-map-loader.
The seventh section resolve allows us to define extensions that will be resolved automatically. This means that in our source code when we import a file that ends in .tsx, .ts or .js we don't need to write the file extension type.
The final section plugins allows for customization of the webpack build process. The line new CopyWebpackPlugin([{ from: path.resolve(__dirname, 'index.html') }]) copies our index.html to the same folder as our bundle.js. new webpack.EnvironmentPlugin({ 'NODE_ENV': 'development' }) sets the NODE_ENV environment variable to development so our code is not minimized. new webpack.HotModuleReplacementPlugin() enables HMR. new webpack.NamedModulesPlugin() shows the relative path of modules when using HMR and new webpack.NoEmitOnErrorsPlugin() will ensure no errors are emitted when calling non-existent assets in development.

Now that we have our configuration file for the development process, we need to write a script for it, so head on over to your package.json-file and add the following lines to scripts:
    // ...
    "scripts": {
        "clean": "rm -rf dist",
        "develop": "yarn clean && webpack-dev-server -d --env=dev --colors --port 9966",
    }

where clean removes our build folder and after that develop starts our development server inside port 9966 so go ahead and run it yarn develop and open up http://localhost:9966 inside your browser.
Production
Next up we want to build our application to be hosted on the Internet, so we begin by creating a configuration file for webpack to use with production called webpack.prod.js (in our root folder):
var path = require('path');
var webpack = require('webpack');
var HtmlWebpackPlugin = require('html-webpack-plugin');

module.exports = {
    context: __dirname,
    entry: path.resolve('src', 'index.tsx'),
    output: {
        filename: 'bundle.js',
        path: path.resolve('dist', 'assets')
    },
    module: {
        rules: [
            {
                test: /\.tsx?$/,
                use: ['babel-loader', 'awesome-typescript-loader'],
                exclude: /node_modules/
            }
        ]
    },
    resolve: {
        extensions: ['.tsx', '.ts', '.js']
    },
    plugins: [
        new HtmlWebpackPlugin(),
        new webpack.DefinePlugin({
            'process.env.NODE_ENV': JSON.stringify('production')
        })
    ]
};

The first two sections are very similar to our development-configuration, as the context is the same, and from entry we have simply removed the lines related to HMR.
The third section output also has the same filename as before, but we have now changed the path where bundled assets should be stored.
For the fourth section module we have removed the source-map-loader and replaced the react-hot-loader in TypeScript files with babel-loader.
The fifth section resolve is identical to our development configuration and for the final section plugins we have removed most of the plugins and added the HtmlWebpackPlugin which will create an index.html for us. We have also set the NODE_ENV environment variable to production.

Now that our configuration is complete, we need to make a script to actually build our files, so add the following line to your package.json inside the scripts-key:
    // ...
    "scripts": {
        // ...
        "build": "yarn clean && webpack -d --env=prod --colors"
    }

where we first delete our previous builds and then build again with the environment for production.
Alternatives

An alternative for webpack is browserify, which I like more (as it is simpler and all configuration is in the scripts), but it does not have all the features I prefer, such as HMR with TypeScript

docs/STYLES.html.body:
Styles
Next up we are going to add styles to our not-so-fancy-yet application. We are going to use Sass as it's perhaps the most widely used CSS preprocessor (and you should use one, as it helps you with managing your styles).
Initialize
First we will again add some dependencies to our project
    yarn add -D node-sass sass-lint
to actually build Sass with node-sass and then lint it with sass-lint.
Next we'll create a .sass-lint.yml file to define the conventions for our Sass-files, you can check the available rules here, but this is what I use
options:
  merge-default-rules: false
rules:
  bem-depth:
    - 4
    - max-depth: 4
  class-name-format:
    - allow-leading-underscore: false
    - convention: hyphenatedbem
  declarations-before-nesting: true
  extends-before-declarations: true

from which the first command merge-default-rules indicates that I do not want to use the default rules as a basis, the second defines that for BEM naming the maximum depth is four, the third that I don't allow class names that start with an underscore and that they must follow hyphenatedbem-convention, the fourth that I want style declarations to be before nested selectors and the last that possible @extend must be before style declarations.
Styles.scss
All of our style-sheets will live inside a folder src/styles and the first will be the "main"-stylesheet, called styles.scss (scss is the Sass file extension)
@import 'variables.scss';
@import 'index.scss';
@import 'button.scss';
@import 'todocomponent.scss';
@import 'loader.scss';

body {
    background-color: $tertiary-color;
    font-family: 'Roboto', sans-serif;
}

and at this point it only imports our other (soon-to-be-written stylesheets) so that the compiler will know to bundle them all and sets two styles on our body, a background-color using the variable $tertiary-color (more about variables in a bit) and a font-family of 'Roboto', with a backup font of sans-serif. But wait, what is this 'Roboto' you might ask? It is the main font of Google's Material Design used in Android etc. and a very nice simple font. Now the way to be able to use it in our styles is to add the following line to the head element of our index.html


which will include the font from Google's CDN.
Variables
Next we will define those things we call variables in Sass in their own file called variables.scss
// Colors
$primary-color: #343488;
$secondary-color: #5656AA;
$tertiary-color: #F0F0FF;
$modal-background: rgba(100, 100, 100, .8);

where the underscore in the beginning of the file name is just a convention to differentiate it from regular style files. Inside it we define four different colors (using comments to define the variable "blocks" of colors, sizes etc. is just another convention), a primary color, secondary color, tertiary color and a color for the background of a modal. All variables in Sass must begin with the dollar $ sign.
Index
Next up is the styles for the Index-page, inside a file called index.scss
@import 'variables.scss';

.index {
    align-items: center;
    display: flex;
    flex-direction: column;
    justify-content: space-around;

    &__header {
        color: $primary-color;
    }

    &__form {
        align-items: inherit;
        display: flex;
        flex-direction: inherit;
        justify-content: inherit;

        &__label {
            margin-bottom: 5px;
        }

        &__input {
            background-color: inherit;
            border: 0;
            border-bottom: 1px solid $primary-color;
            margin-bottom: 10px;
            text-align: center;
            width: 250px;

            &:focus {
                border-bottom: 2px solid $secondary-color;
                outline: none;
            }
        }
    }

    &__todo-container {
        display: flex;
        flex-direction: inherit;
        justify-content: flex-start;
    }
}

where we introduce nesting. I will just explain the simplest use case so you understand what is happening
@import 'variables.scss';
.index {
    align-items: center;
    display: flex;
    flex-direction: column;
    justify-content: space-around;

    &__header {
        color: $primary-color;
    }
}

where we see that first we have defined a block for the class index, which styles the flexbox properties for it. Inside we have another block, which starts with &, which is a special character in Sass as it translates the & ampersand to the parent block's selector. So the above would output as CSS something like this:
.index {
    align-items: center;
    display: flex;
    flex-direction: column;
    justify-content: space-around;
}
.index__header {
    color: #343488;
}


This shows us one the uses of BEM as it ties very nicely with the nesting in Sass. You can read more about the reasoning behind BEM here, but the main point is that BEM is as modular and independent as most JavaScript modules, while keeping it similar for every developer.

Button
In a file called button.scss we are going to write our styles for the Button-component
@import 'variables.scss';

.btn {
    background-color: $tertiary-color;
    border: 1px solid $primary-color;
    border-radius: 50%;
    cursor: pointer;
}

which are very simple, like the component itself.
TodoComponent
The styles for our TodoComponent will be set in a file called todocomponent.scss
@import 'variables.scss';

.todo {
    display: flex;
    flex-direction: row;
    margin-bottom: 10px;

    &__checkbox {
        cursor: pointer;
    }

    &__number {
        margin-left: 5px;
    }

    &__title {
        margin-left: 10px;
    }
}

which is a rather simple style as well, just a little flexbox in there.
Loader
Now this is something a bit more interesting, we are going to make our Loader-component finally come to life, by creating the styles for it inside `loader.scss``
@import 'variables.scss';

.loader {
    animation: .8s fadein .2s linear forwards;
    background: $modal-background;
    height: 200vh;
    left: -50vw;
    opacity: 0;
    position: fixed;
    top: -50vh;
    width: 200vw;
    z-index: 1000;

    &__spinner:before {
        animation: spinner .6s linear infinite;
        border: 2px solid #cccccc;
        border-radius: 50%;
        border-top-color: #333333;
        box-sizing: border-box;
        content: '';
        height: 120px;
        left: 50%;
        margin-left: -60px;
        margin-top: -60px;
        position: fixed;
        top: 50%;
        width: 120px;
    }
}

@keyframes spinner {
    to {
        transform: rotate(360deg);
    }
}

@keyframes fadein {
    from {
        opacity: 0;
    }
    to {
        opacity: 1;
    }
}

and this might use some explaining. There are two major points of interest here, the first being CSS animations and the second being the :before selector.

CSS animations are built by setting a value for animation inside the CSS selector
.selector {
    animation: 1s name 2s linear forwards;
}

where the first variable (optional) is the delay for starting the animation, second is the name of the animation (more about that in a bit), third is the length of the animation, fourth is an animation timing function and the last one is animation fill mode.
Now the animation name has to match a @keyframes selector
@keyframes name {
    from {
        opacity: 0;
    }
    50% {
        opacity: 0.5;
    }
    to {
        opacity: 1;
    }
}

where you define the style for the object being styled at different points of the animation (any CSS style is valid here). You can either specify those styles with percentages (such as the 50% here) or as the from and to selectors (from for the first frame and to for the last one) or mix them up.

The :before selector on the other hand is used to create a child (it must have something set to it's content property to show) for the element, that is used to create some kind of styling otherwise impossible to create, for example in our case the actual spinning element.
Scripts
Now that we have our styles set up, we need to include them in our application and to do that, we are going to update our webpack configurations and update our index.tsx-file a bit, beginning with the index.tsx-change, which is to add the following line as the last import statement:
import './styles/styles.scss';

which is because webpack only bundles files related to the entry-file (our index.tsx).

To use webpack with Sass we need to first add a couple of new development dependencies, so go ahead and:
yarn add -D style-loader css-loader sass-loader extract-text-webpack-plugin
where sass-loader compiles our Sass to CSS, css-loader allows webpack to process CSS, style-loader injects said CSS straight into the HTML (faster for development) and extract-text-webpack-plugin extracts our CSS into a single file when doing production builds.
For our development configuration we only need to add the following new rule to webpack.dev.js:
    // ...
    module: {
        rules: [
            {
                test: /\.scss$/,
                use: ['style-loader', 'css-loader', 'sass-loader']
            }
        ]
    }

where we tell webpack to process our Sass through the described loaders (from right to left).
For our production build we need to do a few more changes into webpack.prod.js:
var ExtractTextPlugin = require('extract-text-webpack-plugin');
// ...
    module : {
        rules: [
            {
                test: /\.scss$/,
                use: ExtractTextPlugin.extract(['css-loader', 'sass-loader'])
            }
        ]
    },
    // ...
    plugins: [
        new ExtractTextPlugin(path.join('styles.css'))
    ]

where at first we use extract-text-webpack-plugin to extract all processed Sass and then in plugins we tell it to save them in a file called styles.css.
Alternatives

Less, another CSS preprocessor
Stylus, the "third" CSS preprocessor (Sass and Less are older)
PostCSS, a CSS postprocessor

docs/TESTING.html.body:
Testing
Even though this part was left as the last one, it is one of the most important parts of a software project and this will only be one way of doing tests.
Initialize
For our testing framework we are going to use Jest, with Enzyme for BDD testing, enzyme-to-json for snapshot testing, ts-jest so Jest plays nice with TypeScript and react-test-renderer for rendering React-components. Because of the new adapters in Enzyme we also need to add the appropriate adapter (in our case for React version 16) and finally we also add a little tool called concurrently to allow the simultaneous running of multiple NPM or Yarn scripts at the same time
    yarn add -D jest ts-jest enzyme enzyme-to-json react-test-renderer enzyme-adapter-react-16 concurrently
setup.js
As Enzyme requires the adapter for React and on top of that error messages related to HTTP-calls can sometimes be incomprehensible, we need to create a small setup file to fix these things, so create a file called setup.js in src/jest-folder and fill it as follows:
// Import adapter for enzyme
var enzyme = require('enzyme');
var Adapter = require('enzyme-adapter-react-16');
enzyme.configure({ adapter: new Adapter() })

// Log all jsDomErrors when using jsdom testEnvironment
window._virtualConsole && window._virtualConsole.on('jsdomError', function (error) {
  console.error('jsDomError', error.stack, error.detail);
});

After that we need to register it for Jest so open up your package.json and add the following:
    "jest": {
        // Other content in the "jest"-object
        "setupTestFrameworkScriptFile": "/src/jest/setup.js"
    }

Linting
Let's start with the easiest part, linting our codebase. For the TypeScript code we already have our linting script setup under lint:ts.
For our Sass files it will be simply
    "scripts": {
        "lint:sass": "sass-lint src/**/*.scss -v --max-warnings 1",
    }

by running sass-lint on the files mathing our glob pattern, adding the v-flag for verbose output and max-warnings to only allow for one warning (you can omit it if you dare).
TS-Jest and enzyme-to-json
We will also need to make some setting for Jest in our package.json to use ts-jest and enzyme-to-json with our code
    "jest": {
        "snapshotSerializers": ["/node_modules/enzyme-to-json/serializer"],
        "transform": {
            ".(ts|tsx)": "/node_modules/ts-jest/preprocessor.js"
        },
        "testRegex": "(/__specs__/.*|\\.(spec))\\.(ts|tsx)$",
        "moduleFileExtensions": ["ts", "tsx", "js"]
    }

where the first setting snapshotSerializers sets Jest to use enzyme-to-json for serializing, testRegex makes it so that Jest looks for tests in folders named __specs__ with the extension spec.ts or spec.tsx and the rest are there so that it uses TS-Jest to build the code.
Button
We will start with one of the simple components, in this case the Button. With all our tests we will follow the convention of having the tests in a folder next to the testable code called __specs__ named [TestableCode].spec.ts or *.tsx if it includes JSX like this
src/
-- components/
-- -- __specs__/
-- -- -- Button.spec.tsx
-- -- Button.tsx
Now the actual content of Button.spec.tsx will look like this
import * as React from 'react';
import { shallow } from 'enzyme';
import Button from '../Button';

describe('Button', () => {
    const click = jest.fn();
    const wrapper = shallow();

    it('should render correctly', () => (
        expect(wrapper).toMatchSnapshot()
    ));

    it('should call the correct function on click', () => {
        const testTimes = 5;
        for (let i = 0; i 

Going through it line by line, the first line of importance is creating a describe-block
describe('Button', () => {});

which Jest uses to group tests together (in this case all tests related to 'Button').

After that we create a mocked function that will allow us to test how many times the function has been called, what values it was called with etc.
    const click = jest.fn();


Next we create a shallow render of the Button
import * as React from 'react';
import { shallow } from 'enzyme';
import Button from '../Button';
// ...
    const button = shallow();

which will allow us to do snapshot testing and to simulate user interaction.

First we test our Button's snapshot (to ensure we don't accidentally change the way it looks like)
    it('should render correctly', () => (
        expect(wrapper).toMatchSnapshot()
    ));

which will create a snapshot-file inside a folder __snapshots__ which you should include in your version control, as it will compare the render to the file if it exists.

it-clauses are Jest's tests and expect defines something to test


Finally we simulate user interaction and ensure it has the correct result
    it('should call the correct function on click', () => {
        const testTimes = 5;
        for (let i = 0; i 
where we first define the number of times we want to simulate a click, then using find (which takes a CSS-selector to find the correct HTML-element) we simulate a click-event and test that the mock function was called the correct amount of times.
Loader
Next up we create a simple snapshot test for our Loader-component
import * as React from 'react';
import { shallow } from 'enzyme';
import Loader from '../Loader';

describe('Loader', () => (
    it('should render correctly', () => (
        expect(shallow()).toMatchSnapshot()
    ))
));

where everything is very similar to the Button-tests.
TodoComponent
Then for our last component TodoComponent we do, once again, similar tests
import * as React from 'react';
import { shallow } from 'enzyme';
import TodoComponent from '../TodoComponent';
import Todo from '../../common/Todo';

describe('TodoComponent', () => {
    const testTodo1 = new Todo(1, 'Title');
    const testTodo2 = new Todo(0, 'Testing', true);
    const setDone = jest.fn();
    const wrapper1 = shallow();
    const wrapper2 = shallow();

    it('should render correctly', () => {
        expect(wrapper1).toMatchSnapshot();
        expect(wrapper2).toMatchSnapshot();
    });

    it('should call setDone correctly', () => {
        wrapper1.find('.todo__checkbox').simulate('change');
        expect(setDone).toBeCalledWith(testTodo1.id);
        expect(setDone).toHaveBeenCalledTimes(1);
        wrapper2.find('.todo__checkbox').simulate('change');
        expect(setDone).toBeCalledWith(testTodo2.id);
        expect(setDone).toHaveBeenCalledTimes(1);
    });
});

where the only difference is that we create two renders and as the setDone function shouldn't be called when the Todo is already done we ensure that it behaves as such.
PageNotFound
For PageNotFound we only need to make a simple snapshot-test
import * as React from 'react';
import { shallow } from 'enzyme';
import PageNotFound from '../PageNotFound';

describe('PageNotFound', () => (
    it('should render correctly', () => (
        expect(shallow()).toMatchSnapshot()
    ))
));

IndexView
Next up we create tests for our IndexView
import * as React from 'react';
import { shallow } from 'enzyme';
import IndexView from '../IndexView';
import Todo from '../../../common/Todo';

describe('IndexView', () => {
    const testTodo1 = new Todo(0, 'title');
    const testTodo2 = new Todo(1, 'testing', true);
    const testTitle = 'A title';
    const testSetTitle = jest.fn();
    const testSaveTodo = jest.fn();
    const testSetDone = jest.fn();
    const wrapperMinimalProps = shallow((

    ));
    const wrapperMaximumProps = shallow((

    ));

    it('should render with correct props', () => {
        expect(wrapperMinimalProps).toMatchSnapshot();
        expect(wrapperMaximumProps).toMatchSnapshot();
    });

    it('should call the correct functions when typing to input field', () => {
        const testValue = 'A_TEST_VALUE';
        wrapperMinimalProps.find('[type="text"]').simulate('change', { target: { value: testValue }});
        expect(testSetTitle).toBeCalledWith(testValue);
    });
});

which is a bit more complex, but in essence built on the same things our previous tests were.

The biggest difference here is that for the simulation function
    it('should call the correct functions when typing to input field', () => {
        const testValue = 'A_TEST_VALUE';
        wrapperMinimalProps.find('[type="text"]').simulate('change', { target: { value: testValue }});
        expect(testSetTitle).toBeCalledWith(testValue);
    });

where we give the change function a value to send with the event and test that it goes to the correct function.
IndexReducer
For the IndexReducer we are not going to use enzyme, but rather normal Jest functions
import { ActionsObservable } from 'redux-observable';
import Todo from '../../../common/Todo';
import IndexReducer, {
    SET_TITLE,
    setTitle,
    SetTitleAction,
    SAVE_TODO,
    saveTodo,
    SaveTodoAction,
    saveTodoEpic,
    SAVE_TODO_SUCCESS,
    saveTodoSuccess,
    SaveTodoSuccessAction,
    SET_DONE,
    setDone,
    SetDoneAction,
    setDoneEpic,
    SET_DONE_SUCCESS,
    setDoneSuccess,
    SetDoneSuccessAction,
    IndexState,
} from '../IndexReducer';

describe('IndexReducer', () => {
    it('should set the correct title as payload on setTitle', () => {
        const payload = 'THIS_IS_A_TEST_TITLE';
        const setTitleAction: SetTitleAction = setTitle(payload);
        expect(setTitleAction).toEqual({ type: SET_TITLE, payload });
        const newState: IndexState = IndexReducer(undefined, setTitleAction);
        expect(newState.title).toEqual(payload);
    });

    it('should set the correct values on saveTodo', () => {
        const saveTodoAction: SaveTodoAction = saveTodo();
        expect(saveTodoAction).toEqual({ type: SAVE_TODO });
        const newState: IndexState = IndexReducer(undefined, saveTodoAction);
        expect(newState.loading).toBeTruthy();
    });

    it('should trigger the correct action on saveTodoEpic', async () => (
        await saveTodoEpic(ActionsObservable.of(saveTodo()), undefined)
            .forEach(actionReceived => expect(actionReceived).toEqual({ type: SAVE_TODO_SUCCESS }))
    ));

    it('should set the correct values on saveTodoSuccess', () => {
        /* tslint:disable:no-magic-numbers */
        const testT = new Todo(1, 'Doing', true);
        const initialState: IndexState = { title: 'TEST', todos: [testT], loading: true };
        const saveTodoSuccessAction: SaveTodoSuccessAction = saveTodoSuccess();
        expect(saveTodoSuccessAction).toEqual({ type: SAVE_TODO_SUCCESS });
        const newState: IndexState = IndexReducer(initialState, saveTodoSuccessAction);
        expect(newState.title).toEqual('');
        expect(newState.todos.length).toEqual(2);
        expect(newState.todos[1].done).toBeFalsy();
        expect(newState.todos[1].id).toEqual(2);
        expect(newState.todos[1].title).toEqual(initialState.title);
        expect(newState.loading).toBeFalsy();
        /* tslint:enable:no-magic-numbers */
    });

    it('should set the correct values on setDone', () => {
        const setDoneAction: SetDoneAction = setDone(0);
        expect(setDoneAction).toEqual({ type: SET_DONE, payload: 0 });
        const newState: IndexState = IndexReducer(undefined, setDoneAction);
        expect(newState.loading).toBeTruthy();
    });

    it('should trigger the correct action on setDoneEpic', async () => (
        await setDoneEpic(ActionsObservable.of(setDone(0)), undefined)
            .forEach(actionReceived => expect(actionReceived).toEqual({ type: SET_DONE_SUCCESS, payload: 0 }))
    ));

    it('should set the correct values on setDoneSuccess', () => {
        const initialState: IndexState = { title: '', todos: [new Todo(0, '')], loading: true };
        const setDoneSuccessAction: SetDoneSuccessAction = setDoneSuccess(0);
        expect(setDoneSuccessAction).toEqual({ type: SET_DONE_SUCCESS, payload: 0 });
        const newState: IndexState = IndexReducer(initialState, setDoneSuccessAction);
        expect(newState.loading).toBeFalsy();
        expect(newState.todos[0].done).toBeTruthy();
        expect(newState.todos[0].id).toEqual(initialState.todos[0].id);
        expect(newState.todos[0].title).toEqual(initialState.todos[0].title);
    });
});

where we test each of our action creator-functions and epics (we validate our reducer itself via the action creators).

I also highly recommend always explicitly setting the type of values in your tests, as accidentally changing the values in your code will result in a compiler error then.


For the first action creator setTitle we do it as follows
import IndexReducer, { SET_TITLE, setTitle, SetTitleAction } from '../IndexReducer';
// ...
    it('should set the correct title as payload on setTitle', () => {
        const payload = 'THIS_IS_A_TEST_TITLE';
        const setTitleAction: SetTitleAction = setTitle(payload);
        expect(setTitleAction).toEqual({ type: SET_TITLE, payload });
        const newState = IndexReducer(undefined, setTitleAction);
        expect(newState.title).toEqual(payload);
    });

where we first check that it has the correct return values and types and then test that running it through our IndexReducer has the desired effects. The same is done for saveTodo, saveTodoSuccess, setDone and setDoneSuccess.

Possibly the most important part of our testing is testing our epics, for example in the case of our saveTodoEpic
import { ActionsObservable } from 'redux-observable';
import { SAVE_TODO_SUCCESS, saveTodo } from '../IndexReducer';
// ...
    it('should trigger the correct action on saveTodoEpic', async () => (
        await saveTodoEpic(ActionsObservable.of(saveTodo()), undefined)
            .forEach(actionReceived => expect(actionReceived).toEqual({ type: SAVE_TODO_SUCCESS }));
    ));

where we have to use an async function, as Observables are not synchronous. We use ActionsObservable.of to create an Observable out of our action creator and give our epic an undefined as the second argument (which, if you remember is defined as a type of undefined in IndexReducer). After that we subscribe to our new Observable returned by saveTodoEpic and check that the action received matches what we expect.

In our case we don't have any AJAX calls, but most likely you will require them, so to test them you would do something like this
import * as nock from 'nock';
import { ActionsObservable } from 'redux-observable';
import { State } '../../../redux/reducer';
import IndexReducer, {
    fetchTodo,
    fetchTodoSuccess,
    fetchTodoFail,
    fetchTodoEpic,
} from '../IndexReducer';

describe('fetchTodoEpic', () => {
    afterEach(() => {
        nock.cleanAll();
    });
    it('should return the correct effects', async () => {
        const payload = 'Todo';
        nock('path/to/endpoint')
            .get('/lastparam')
            .reply(200, payload, { 'Content-Type': 'application/json' });
        return await fetchTagsEpic(ActionsObservable.of(fetchTodo()), { getState: () => new State(), dispatch: () => {} })
            .forEach(actionReceived => expect(actionReceived).toEqual(fetchTodoSuccess(payload)));
    });
    it('should fail correctly', async () => {
        const payload = 'ERROR';
        nock('path/to/endpoint')
            .get('/lastparam')
            .replyWithError(payload);
        return await fetchTagsEpic(ActionsObservable.of(fetchTodo()), { getState: () => new State(), dispatch: () => {} })
            .forEach(actionReceived => expect(actionReceived).toEqual(fetchTodoFail(payload)));
    });
});

where we use nock to mock the API responses.
AppView
We also add simple snapshot tests for our AppView
import * as React from 'react';
import { shallow } from 'enzyme';
import createHistory from 'history/createBrowserHistory';
import AppView from '../AppView';

describe('AppView', () => {
    const index = (

    );
    const notFound = (

    );

    it('should render correctly', () => {
        expect(shallow(index)).toMatchSnapshot();
        expect(shallow(notFound)).toMatchSnapshot();
    });
});

Scripts
Finally we also want to run our tests! So back into our package.json
    "scripts": {
        "test": "concurrently --kill-others-on-fail -p \"{name}\" -n \"SASS-LINT,TS-LINT,JEST\" -c \"bgBlue,bgMagenta,bgCyan\" \"yarn lint:sass\" \"yarn lint:ts\" \"jest\"",
        "test:watch": "jest --watch",
        "test:ci": "yarn run lint:sass && yarn run lint:ts && jest --runInBand --forceExit",
    }

where the first command test will run our lint-scripts and Jest with its default configuration (--kill-others-on-fail will kill all three running processes if one test process fails). test:watch will run Jest in watch mode, so when you're working on your tests, it will only run the ones your changes affect, saving time. The last one test:ci adds a couple of flags to the Jest command, --runInBand which will run all tests in a single process (easier to spot errors) and --forceExit to ensure Jest will shut down after tests (Travis can freeze without this sometimes).
Alternatives

Possibly the best known alternative to Jest is Mocha
Jasmine is one of the tools often used to extend Mocha
Chai is another one of them
And so is Sinon

docs/EXTRAS.html.body:
Extras
Here we go through things you might not need, but might want to include in your project.
Server-side rendering
Server-side rendering is the act of having a server render your React-application and sending it as an html file to the client, which can considerably reduce initial loading times and enables a lot of SEO. This is usually achieved by adding a node-server to your application and then hosting your code on a server.
For our needs, we'll use Express, starting with installing the new, required dependencies (http-status-enum is just a simple enumeration of HTTP Status Codes for TypeScript)
    yarn add express http-status-enum
    yarn add -D @types/express

Now the actual server we run will live in a file called server.tsx inside the src-folder
import * as path from 'path';
import * as express from 'express';
import * as React from 'react';
import HttpStatus from 'http-status-enum';
import { Provider } from 'react-redux';
import { renderToString } from 'react-dom/server';
import { StaticRouter, Route } from 'react-router-dom';
import { routerMiddleware } from 'react-router-redux';
import createHistory from 'history/createMemoryHistory';
import { createStore, applyMiddleware } from 'redux';
import { createEpicMiddleware } from 'redux-observable';
import reducer, { epics, State } from './redux/reducer';
import AppContainer from './modules/AppContainer';

const normalizePort = (val: number | string): number | string | boolean => {
    const base = 10;
    const port: number = typeof val === 'string' ? parseInt(val, base) : val;
    return isNaN(port) ? val : port >= 0 ? port : false;
};

const renderHtml = (html: string, preloadedState: State) =>
    `




            Todo app




            ${html}

                window.__PRELOADED_STATE__ = ${JSON.stringify(preloadedState).replace(/



    `;

const defaultPort = 8080;
const port = normalizePort(process.env.PORT || defaultPort);
const app = express();

app.use('/assets', express.static(path.join('assets'), { redirect: false }));

app.use((req: express.Request, res: express.Response) => {
    const store = createStore(
        reducer,
        applyMiddleware(routerMiddleware(createHistory()), createEpicMiddleware(epics)),
    );
    const context: { url?: string } = {};
    const html = renderToString(




        ,
    );
    if (context.url) {
        res.redirect(HttpStatus.MOVED_PERMANENTLY, context.url);
    } else {
        res.send(renderHtml(html, store.getState()));
    }
});

app.listen(port, () => console.log(`App is listening on ${port}`));

which will serve the React-application on all other routes except ROOT/assets, where our assets are served from.

First we made a simple function to normalize an incoming PORT-parameter
const normalizePort = (val: number | string): number | string | boolean => {
    const base = 10;
    const port: number = typeof val === 'string' ? parseInt(val, base) : val;
    return isNaN(port) ? val : port >= 0 ? port : false;
};

which tries to parse the incoming val-parameter.

Next we create a function to render our html based on the rendered React application
const renderHtml = (html: string, preloadedState: State) => (
    `




            Todo app




            ${html}

                window.__PRELOADED_STATE__ = ${JSON.stringify(preloadedState).replace(/



    `
);

where the biggest point is window.__PRELOADED_STATE__ which lets us set the state of the application in the server, although it requires the following modification to our `store.ts``
// Below is a necessary hack to access __PRELOADED_STATE__ on the global window object
const preloadedState: State = (window).__PRELOADED_STATE__;
delete (window).__PRELOADED_STATE__;
const configureStore = (history: History) => createStore(
    reducer,
    preloadedState,
    applyMiddleware(epicMiddleware),
);


Next we set some required variables and create our Express-application
const defaultPort = 8080;
const port = normalizePort(process.env.PORT || defaultPort);
const app = express();

where we use our previously created normalizePort to normalize the (possibly) given PORT environment variable.

Next up we set up Express to serve our static assets
app.use('/js', express.static(path.join('js'), { redirect: false }));
app.use('/styles', express.static(path.join('styles'), { redirect: false }));

with use you can set a middleware-function to a specific path, in this case express.static, which will serve static files from a relative path.

path.join will create a path using platform-specific separators.


Next is the beef of our server application, the actual server-side rendering
app.use((req: express.Request, res: express.Response) => {
    const store = createStore(reducer, applyMiddleware(
        routerMiddleware(createHistory()),
        createEpicMiddleware(epics),
    ));
    const context: { url?: string } = {};
    const html = renderToString(




        ,
    );
    if (context.url) {
        res.redirect(HttpStatus.MOVED_PERMANENTLY, context.url);
    } else {
        res.send(renderHtml(html, store.getState()));
    }
});

where we use react-router to match the current path to our client code, where the match-function matches the current route without rendering. Afterwards we create a store and render the application as html and finally send it to the client.

Finally we start the application itself
app.listen(port, () => console.log(`App is listening on ${port}`));


Of course we need to again make some changes to our webpack configurations, but this time only to the production configuration and then we need to create a configuration for the server code itself.
For the production configuration we want to remove our index.html creation plugin as the server itself serves the index file, so remove the following lines:
var HtmlWebpackPlugin = require('html-webpack-plugin');
// ...
        new HtmlWebpackPlugin(),

after which, we can remove the plugin itself, by running
yarn remove html-webpack-plugin

For the building of the server side code, we need to create another webpack configuration file, this time called webpack.server.js, which will have the following content:
var path = require('path');
var webpack = require('webpack');

module.exports = {
    target: 'node',
    entry: path.resolve(__dirname, 'src', 'server.tsx'),
    output: {
        filename: 'server.js',
        path: path.resolve(__dirname, 'dist')
    },
    module: {
        rules: [
            {
                test: /\.tsx?$/,
                loader: ['babel-loader', 'awesome-typescript-loader'],
                exclude: /node_modules/
            }
        ]
    },
    resolve: {
        extensions: ['.tsx', '.ts', '.js']
    }
};

where we simply define the entry to be server.tsx, the output folder to be dist (with the output file being server.js) and make it process TypeScript.
Then we also need to update our build scripts to include our server, so we change the old build-script into the following three scripts:
"scripts": {
    "build:server": "webpack -d --env=server -p --colors",
    "build:client": "webpack -d --env=prod --colors",
    "build": "yarn clean && concurrently --kill-others-on-fail -p \"{name}\" -n \"SERVER,CLIENT\" -c \"bgBlue,bgMagenta\" \"yarn build:server\" \"yarn build:client\"",
}

where the build:client-script is the same as before, build:server calls webpack with our new server configuration and build runs both of these at the same time using concurrecntly.

Finally we create the actual start-script which will run our application
    "scripts": {
        "start": "cd dist && NODE_ENV=production node server.js",
    }

which is very simple, just setting the production-flag for our NODE_ENV and starting the server with node.
That's it, you should now have fully working server-side rendered application!
Docker
If you want to dockerize your application you need to add a Dockerfile to your application's root folder (which is just a file named Dockerfile)
FROM node:4-onbuild

LABEL maintainer "your.email.here@domain.com"

COPY dist/ /

ENV NODE_ENV=production

EXPOSE 8080

CMD node /server.js
which tells Docker how to build your container (installation instructions for Docker can be found here).
To start your new Docker-container you can just run
docker build .
then take the image id given by the build command and use it here
docker run -d -p 8080:8080 IMAGEID
